full_text:
@GregHuntMP @PeterMacCC @ScottMorrisonMP Not enough. @AusLiberalParty want to fight Medicare/scare battles with @AustralianLabor? 
Then commit. 
Lift the freeze AND increase rates. New rebates for patients for telehealth/ phone consults. Increased funding for chronic/ mental health with details. #auspol

@LiberalAus Not enough. @ScottMorrisonMP @GregHuntMP want to fight Medicare/scare battles with @AustralianLabor? 
Then commit. 
Lift the freeze &amp; increase rates. New rebates for patients for telehealth/ phone consults. Increased funding for chronic/ mental health with details. #auspol

@billshortenmp Not far enough @billshortenmp 
Show us your genuine support for Medicare; 
Raise rebates, not just unfreeze. Incorporate telehealth rebates.
Reform chronic disease management funding and mental health to best rebate those patients with higher needs.
#justaGP #auspol #Mediscare

